import{_ as t,a as o,o as i,ag as a}from"./chunks/framework.Do1Zayaf.js";const s="/HPCC-Platform/assets/TestRunner.BJMMRNP1.png",n="data:image/png;base64,",l="data:image/png;base64,",r="/HPCC-Platform/assets/URLMapping.QjPpvxVW.png",d="/HPCC-Platform/assets/Config.C3G4bhJk.png",c="/HPCC-Platform/assets/URLConfig1.eiUFEP8c.png",u="/HPCC-Platform/assets/URLConfig2.C3GqCLLN.png",h="/HPCC-Platform/assets/Common1.l44qDmeG.png",g="data:image/png;base64,",m="/HPCC-Platform/assets/CustomFormatter.CB0QiR6O.png",p="/HPCC-Platform/assets/TimeUtils.CjpgdZvL.png",f="/HPCC-Platform/assets/NavigationWebElement.CfzeJfZA.png",A="data:image/png;base64,",b="/HPCC-Platform/assets/WUQueryResponse.DmSQ8Dnl.png",v="/HPCC-Platform/assets/WUWorkunits.DyuilWxl.png",q="/HPCC-Platform/assets/WUECLWorkunit.DODYTu5I.png",k="data:image/png;base64,",T="data:image/png;base64,",P="/HPCC-Platform/assets/ActivitiesTest.CJbnQIQ7.png",C="/HPCC-Platform/assets/BaseTableTest1.B-hqRppv.png",y="/HPCC-Platform/assets/BaseTableTest2.DCIdcB9h.png",w="/HPCC-Platform/assets/ECLWorkUnitsTest.Hz75FCzq.png",S="/HPCC-Platform/assets/DFULogicalFile.BooXkhlK.png",L="data:image/png;base64,",O="/HPCC-Platform/assets/DFUQueryResponse.p_0_892t.png",N="data:image/png;base64,",R="/HPCC-Platform/assets/FilesLogicalFilesTest.xO3p0YkV.png",V="/HPCC-Platform/assets/Relationship.Ccy6fGWb.png",j=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"esp/src/test-ui/tests/framework/documentation/DesignDocument.md","filePath":"esp/src/test-ui/tests/framework/documentation/DesignDocument.md","lastUpdated":1771585025000}'),x={name:"esp/src/test-ui/tests/framework/documentation/DesignDocument.md"};function z(X,e,J,U,E,I){return i(),o("div",null,e[0]||(e[0]=[a('<h2 id="the-class-design-and-code-flow-for-ecl-watch-test-suite" tabindex="-1">The Class Design and Code Flow for ECL Watch Test Suite <a class="header-anchor" href="#the-class-design-and-code-flow-for-ecl-watch-test-suite" aria-label="Permalink to &quot;The Class Design and Code Flow for ECL Watch Test Suite&quot;">​</a></h2><h3 id="testrunner-java" tabindex="-1">TestRunner.java <a class="header-anchor" href="#testrunner-java" aria-label="Permalink to &quot;TestRunner.java&quot;">​</a></h3><p><img src="'+s+'" alt="img.png"></p><p>The TestRunner class is responsible for setting up and executing automated tests using the TestNG framework in a Selenium-based testing environment. It handles the initialization of logging and WebDriver, dynamically loads the test classes to be executed, and runs the tests.</p><p>Variables: args: Command line arguments passed to the main method. While running the test suite, you can pass arguments in this way -&gt; &quot;-l log_level -p path&quot;.</p><ul><li>&quot;log_level&quot; is of two types &quot;debug&quot; and &quot;detail&quot;</li><li>&quot;debug&quot; means generate error and exception log file with a debug log file.</li><li>&quot;detail&quot; means generate error and exception log file with a detailed debug file.</li><li>If no -l and log_level is passed in the argument, only error and exception log will be generated</li><li>&quot;path&quot; is the path of the folder where the json files are</li><li>The code will log an error if the &#39;-p&#39; and &#39;path&#39; arguments are not provided, as the JSON folder path is required for the test suite.</li><li>-h in the CLI arguments prints the details of parameter usage to the console</li></ul><p>path could be something like:</p><p>for GitHub Actions -&gt; /home/runner/HPCCSystems-regression/log/</p><p>for local machine -&gt; C:/Users/{your_working_directory_of_json_files}/</p><p>So an example of complete CLI arguments would look like this:</p><p>-l detail -p /home/runner/HPCCSystems-regression/log/</p><p><strong>Methods:</strong></p><ol><li>main Method</li></ol><p>The entry point of the application. It performs the following steps:</p><ul><li>Calls getCommandLineParameters method to get the log level and the path of JSON files from CLI arguments and configure them in the Config file.</li><li>Calls Common.initializeLoggerAndDriver to configure the logging system and web driver.</li><li>If the drives sets up properly and is not null, it creates an instance of TestNG.</li><li>Sets the test classes to be run by calling loadClasses.</li><li>Runs the tests using TestNG.</li><li>Quits the WebDriver session after the tests have completed.</li><li>Calls Common.printNumOfErrorsAndExceptions to print total number of errors and exceptions to the console, so that we get an idea of the count after the tests are finished.</li></ul><ol start="2"><li>loadClasses Method</li></ol><p>Loads the test classes specified in TestClasses.testClassesList:</p><ul><li>Iterates over the testClassesList and loads each class by its fully qualified name.</li><li>Adds the loaded class to the list classes.</li><li>Catches and prints any ClassNotFoundException.</li></ul><ol start="3"><li>getCommandLineParameters Method</li></ol><p>This method is designed to parse command-line arguments to set the log level and the path to a folder containing JSON files. It validates the presence of these arguments and sets configuration values accordingly.</p><ul><li>It takes a single parameter, args, which is an array of strings representing the command-line arguments passed to the program.</li><li>Three local variables, log_level, path and help, are initialized to null. These will hold the values extracted from the command-line arguments.</li><li>A for loop iterates through the args array to examine each argument.</li><li>The loop uses i as the index variable to traverse the array.</li><li>Inside the loop, check if the current argument equals &quot;-l&quot;.</li><li>If &quot;-l&quot; is found and there is another argument following it (i + 1 &lt; args.length), assign the value of the next argument to log_level and increment the index i to skip the processed argument.</li><li>Similarly, check if the current argument equals &quot;-p&quot;.</li><li>If &quot;-p&quot; is found and there is another argument following it (i + 1 &lt; args.length), assign the value of the next argument to path and increment the index i to skip the processed argument.</li><li>If &quot;-h&quot; is found, assign true to help.</li><li>After the loop, check if log_level is not null. If it is not null, assign its value to Config.LOG_LEVEL.</li><li>Check if path is not null. If it is not null, assign its value to Config.PATH_FOLDER_JSON.</li><li>If path is still null after the loop, log an error message indicating that the JSON folder path is required. Use Common.logError to log this error.</li><li>Check if help is true. If help is true call printParameterUsage method to print the details of parameter usage to the console.</li></ul><ol start="4"><li>printParameterUsage Method</li></ol><p>This method just print the details of parameter usage to the console for better user interaction.</p><h3 id="testclasses-java" tabindex="-1">TestClasses.java <a class="header-anchor" href="#testclasses-java" aria-label="Permalink to &quot;TestClasses.java&quot;">​</a></h3><p><img src="'+n+'" alt="img_4.png"></p><p>The TestClasses class in the framework.config package is responsible for maintaining a list of test classes used in the framework. This class provides a centralized and immutable collection of test class metadata, which includes the name of each test class and its fully qualified class name. This setup helps organize and reference the test classes easily throughout the testing framework. By using the TestClasses class, the framework can dynamically load and execute tests, enhancing modularity and maintainability.</p><h3 id="testclass-java" tabindex="-1">TestClass.java <a class="header-anchor" href="#testclass-java" aria-label="Permalink to &quot;TestClass.java&quot;">​</a></h3><p><img src="'+l+'" alt="img_3.png"></p><p>The TestClass class in the framework.model package is a simple model class designed to encapsulate metadata about a test class within the testing framework. It contains the name of the test class and its fully qualified class name (path). This class provides a structured way to store and retrieve information about each test class, which can be utilized by other components in the framework for dynamically loading and executing tests.</p><h3 id="urlmapping-java" tabindex="-1">URLMapping.java <a class="header-anchor" href="#urlmapping-java" aria-label="Permalink to &quot;URLMapping.java&quot;">​</a></h3><p><img src="'+r+'" alt="img.png"></p><p>The URLMapping class in the framework.model package is a model that represents a URL and its associated metadata. It provides a structured way to store URLs and their hierarchical relationships, facilitating easy navigation and retrieval of URLs in a web application.</p><h4 id="variables" tabindex="-1">Variables: <a class="header-anchor" href="#variables" aria-label="Permalink to &quot;Variables:&quot;">​</a></h4><ul><li>name: A String representing the name of the navigation element or tab.</li><li>url: A String representing the URL associated with the navigation element or tab.</li><li>urlMappings: A HashMap&lt;String, URLMapping&gt; that maps the names of nested navigation elements or tabs to their corresponding URLMapping objects.</li></ul><h3 id="config-java" tabindex="-1">Config.java <a class="header-anchor" href="#config-java" aria-label="Permalink to &quot;Config.java&quot;">​</a></h3><p><img src="'+d+'" alt="img.png"></p><p>The Config class in the framework.config package serves as a centralized configuration repository for the application. It contains various constants that are used throughout the framework, providing a single point of reference for configuration settings such as file paths, file names, flags, and other constants. This approach enhances the maintainability and readability of the code by avoiding hard-coded values scattered across different classes.</p><h3 id="urlconfig-java" tabindex="-1">URLConfig.java <a class="header-anchor" href="#urlconfig-java" aria-label="Permalink to &quot;URLConfig.java&quot;">​</a></h3><p><img src="'+c+'" alt="img.png"><img src="'+u+'" alt="img.png"></p><p>The URLConfig class is designed to manage the URL configurations for different navigation and tab pages within the test cases. It provides a structured way to store and retrieve URLs associated with various sections of the ECL Watch UI. This class uses constants to define URLs and page names, and it leverages a HashMap to store URL mappings, facilitating easy access to the URLs of different pages and tabs.</p><ul><li>NAV_ACTIVITIES, NAV_ECL, NAV_FILES, NAV_PUBLISHED_QUERIES, NAV_OPERATIONS: Constants representing main navigation sections.</li><li>TAB_ACTIVITIES_ACTIVITIES, TAB_ACTIVITIES_EVENT_SCHEDULER: Tab names under the Activities navigation.</li><li>TAB_ECL_WORKUNITS, TAB_ECL_PLAYGROUND: Tab names under the ECL navigation.</li><li>TAB_FILES_LOGICAL_FILES, TAB_FILES_LANDING_ZONES, TAB_FILES_WORKUNITS, TAB_FILES_XREF: Tab names under the Files navigation.</li><li>TAB_PUBLISHED_QUERIES_QUERIES, TAB_PUBLISHED_QUERIES_PACKAGE_MAPS: Tab names under the Published Queries navigation.</li><li>TAB_OPERATIONS_TOPOLOGY, TAB_OPERATIONS_DISK_USAGE, TAB_OPERATIONS_TARGET_CLUSTERS, TAB_OPERATIONS_CLUSTER_PROCESSES, TAB_OPERATIONS_SYSTEM_SERVERS, TAB_OPERATIONS_SECURITY, TAB_OPERATIONS_DYNAMIC_ESDL: Tab names under the Operations navigation.</li><li>navNamesArray: Array containing all the main navigation names.</li><li>tabsListMap: Map containing lists of tab names associated with each main navigation section.</li><li>urlMap: A HashMap (urlMap) is created to store URL mappings. This map will use the page name as the key and a URLMapping object as the value. The URLMapping object contains the page name, its URL, and another HashMap for nested pages and tabs.</li><li>A static block is used to initialize the urlMap with the initial URL mapping for the Activities navigation. The URL is retrieved using a method from the Common utility class, which handles the dynamic retrieval of the IP address based on the environment whether it is local or GitHub Actions.</li></ul><h4 id="implementation-steps-for-url-management" tabindex="-1">Implementation Steps for URL Management <a class="header-anchor" href="#implementation-steps-for-url-management" aria-label="Permalink to &quot;Implementation Steps for URL Management&quot;">​</a></h4><ul><li>For each main navigation section, a URLMapping object is created. This object includes the page name and its corresponding URL. Additionally, it contains another HashMap to store URLs for nested tabs and pages.</li><li>Each URLMapping object is stored in the urlMap with the main navigation name as the key. This initial setup ensures that each navigation section has its base URL stored and accessible.</li><li>For instance, for any navigation page, each page has multiple tabs, and within those tabs, there are multiple pages and tabs. This structure facilitates easy access to the URL of a particular page.</li><li>Starting from the Activities page, for each main navigation section, the code iterates over its associated tabs (as defined in tabsListMap). For each tab, a new URLMapping object is created and added to the HashMap within the corresponding URLMapping object of the main navigation section. This creates a tree-like structure, allowing easy access to URLs for both navigation sections and their nested tabs.</li><li>By following these implementation steps, the URLConfig class ensures that all URLs within the application are well-organized and easily accessible through a hierarchical structure. This setup simplifies navigation and URL management within the application, making it easier to handle complex page structures and dynamic URL retrievals.</li></ul><h3 id="common-java" tabindex="-1">Common.java <a class="header-anchor" href="#common-java" aria-label="Permalink to &quot;Common.java&quot;">​</a></h3><p><img src="'+h+'" alt="img.png"><img src="'+g+'" alt="img.png"></p><p>The Common class in the framework.utility package provides a set of utility methods that are frequently used throughout the testing framework. These methods handle common tasks and leverages constants from the Config class to maintain consistency and facilitate configuration management.</p><p>Variables:</p><ul><li>driver: This public static variable stores the WebDriver instance used for interacting with the web browser.</li><li>errorLogger: This public static variable stores a logger instance used for logging error messages.</li><li>specificLogger: This public static variable stores a logger instance used for logging specific messages based on the provided level (debug or detail).</li><li>num_errors: A counter to keep a count of total numbers of errors generated in the error log file.</li><li>num_exceptions: A counter to keep a count of total numbers of exceptions generated in the exceptions log file.</li></ul><p><strong>Methods:</strong></p><ol><li>checkTextPresent Method</li></ol><p>Checks if the specified text is present on the current webpage and logs the result.</p><ul><li>Retrieves the page source using driver.getPageSource().</li><li>Checks if the page source contains the specified text.</li><li>Logs a success message if the text is found; otherwise, logs an error message and records it using the provided logger.</li></ul><ol start="2"><li>openWebPage Method</li></ol><p>Opens the specified URL in the browser and maximizes the window.</p><ul><li>Navigates to the specified URL using driver.get(url).</li><li>Maximizes the browser window using driver.manage().window().maximize().</li><li>Calls the sleep method to pause the execution for a short period to allow the page to load completely.</li></ul><ol start="3"><li>sleep Method</li></ol><p>The sleep method pauses the execution of the program for a specified duration (4 seconds in this case). This can be useful in scenarios where a delay is required, such as waiting for a webpage to load completely before proceeding with further actions.</p><ol start="4"><li>isRunningOnLocal Method</li></ol><p>Determines if the code is running on a local environment.</p><ul><li>Checks if the operating system name starts with the value of Config.LOCAL_OS.</li><li>Checks if the user profile path starts with the value of Config.LOCAL_USER_PROFILE.</li><li>Returns true if both conditions are met, indicating a local environment; otherwise, returns false.</li></ul><ol start="5"><li>getIP Method</li></ol><p>The getIP method determines the appropriate IP address to use based on whether the application is running in a local environment or in a GitHub Actions environment. This helps in dynamically adjusting the base URL of the application depending on the execution context.</p><ul><li>Calls isRunningOnLocal to check the environment.</li><li>If running locally, returns the URLConfig.LOCAL_IP.</li><li>If running in GitHub Actions, returns the URLConfig.GITHUB_ACTION_IP.</li></ul><ol start="6"><li>waitForElement Method</li></ol><ul><li>This method waits for a web element to be present in the DOM.</li><li>Uses WebDriverWait to wait up to 10 seconds for the presence of the specified web element.</li></ul><ol start="7"><li>logError Method</li></ol><ul><li>This method logs error messages.</li><li>Prints the error message to the standard error stream.</li><li>Logs the message using errorLogger.</li><li>Increments the variable num_errors by 1, to maintain the count of number of errors generated.</li></ul><ol start="8"><li>logException Method</li></ol><ul><li>This method logs exception messages with complete stack trace.</li><li>Prints the exception message with complete stack trace to the standard error stream.</li><li>Logs the message using errorLogger.</li><li>Increments the variable num_exceptions by 1, to maintain the count of number of num_exceptions generated.</li></ul><ol start="9"><li>logDebug Method</li></ol><ul><li>This method logs debug or detailed messages.</li><li>Prints the message to the standard output stream.</li><li>Logs the message using specificLogger if the logging level is INFO or FINE.</li></ul><ol start="10"><li>logDetail method</li></ol><ul><li>This method logs detailed messages.</li><li>Prints the message to the standard output stream.</li><li>Logs the message using specificLogger if the logging level is FINE.</li></ul><ol start="11"><li>initializeLoggerAndDriver Method</li></ol><ul><li>This method initializes the logger and WebDriver instances.</li><li>Sets up the specificLogger based on the provided argument.</li><li>Sets up the WebDriver instance using setupWebDriver() method.</li></ul><ol start="12"><li>setupWebDriver Method</li></ol><ul><li>This method sets up the WebDriver instance based on the environment.</li><li>Configures ChromeOptions for headless mode, no sandbox, and suppressed log output.</li><li>Sets up the WebDriver based on the environment (local or GitHub Actions).</li><li>Logs an error message if an exception occurs during setup.</li></ul><ol start="13"><li>setupLogger Method</li></ol><ul><li>This method sets up a logger instance based on the provided log level (error, exception, debug and detail).</li><li>It creates a CustomFormatter instance. This formatter will be used to format log messages according to a specified pattern.</li><li>Configures the logger to disable console logging and set up file handlers for different log levels (error, exception, debug, detail).</li><li>For &quot;error&quot; and &quot;exception&quot; levels, it sets up a FileHandler with a corresponding file path from Config.LOG_FILE_ERROR or Config.LOG_FILE_EXCEPTION, respectively. The log level is set to Level.SEVERE.</li><li>For &quot;debug&quot;, it sets up a FileHandler with Config.LOG_FILE_DEBUG and sets the log level to Level.INFO.</li><li>For &quot;detail&quot;, it sets up a FileHandler with Config.LOG_FILE_DETAIL and sets the log level to Level.FINE.</li><li>Turns off all logging from Selenium WebDriver.</li><li>Logs an error message if an exception occurs during logger setup.</li><li>Finally, the method returns the configured Logger instance.</li></ul><ol start="14"><li>sleepWithTime Method</li></ol><ul><li>The sleepWithTime method pauses the execution of the current thread for a specified number of seconds.</li><li>It is a simple utility method used to introduce a delay in the execution flow.</li><li>Used to wait for a certain condition or state before proceeding with further execution.</li></ul><ol start="15"><li>waitForElementToBeClickable Method</li></ol><ul><li>This method waits until the specified web element is clickable.</li><li>A WebDriverWait instance is created with a timeout duration specified by Config.WAIT_TIME_THRESHOLD_IN_SECONDS.</li><li>The method waits until the element is clickable, using Selenium&#39;s ExpectedConditions.elementToBeClickable condition.</li><li>It is useful in scenarios where an element needs to be interacted with, but it might not be immediately clickable due to loading times or other conditions.</li></ul><ol start="16"><li>waitForElementToBeDisabled Method</li></ol><p>The waitForElementToBeDisabled method waits until the specified web element is disabled by checking its aria-disabled attribute. The attribute &quot;aria-disabled&quot; is part of the Accessible Rich Internet Applications (ARIA) specification, which is used to improve the accessibility of web pages. aria-disabled is a standard attribute and is widely used in HTML to indicate whether an element is disabled. It is system-defined, meaning it is part of the standard HTML specifications and not a custom class or attribute that might change frequently. By using aria-disabled, you ensure that the check for the disabled state is consistent and less likely to break due to UI changes. Custom class names or attributes defined by developers can change frequently during updates or redesigns, but standard attributes like aria-disabled are much more stable.</p><ul><li>A WebDriverWait instance is created with a timeout duration specified by Config.WAIT_TIME_THRESHOLD_IN_SECONDS.</li><li>The method waits until the aria-disabled attribute of the element contains the value &quot;true&quot;, indicating that the element is disabled.</li><li>Ensures that an element has transitioned to a disabled state before proceeding with further actions.</li></ul><h3 id="customformatter-java" tabindex="-1">CustomFormatter.java <a class="header-anchor" href="#customformatter-java" aria-label="Permalink to &quot;CustomFormatter.java&quot;">​</a></h3><p><img src="'+m+'" alt="img.png"></p><p>The CustomFormatter class in the framework.utility package extends Formatter and uses a SimpleDateFormat instance to define the format of the timestamps in the log messages. The format specified is &quot;yyyy-MM-dd HH:mm:ss&quot;, which outputs timestamps in a year-month-day hour:minute:seconds format.</p><ol><li>format Method</li></ol><ul><li>The format method overrides the abstract method from the Formatter class to define how log records should be formatted.</li><li>It takes a LogRecord object as a parameter, which contains information about the log message, including the timestamp and the message itself.</li><li>The method converts the timestamp from milliseconds since the epoch (obtained from record.getMillis()) into a Date object.</li><li>It then formats this Date object using the SimpleDateFormat instance to get a readable date-time string.</li><li>Finally, it returns a formatted string consisting of the formatted date-time followed by the log message and a newline character. This ensures that each log entry starts with a timestamp and is followed by the log message.</li></ul><h3 id="timeutils-java" tabindex="-1">TimeUtils.java <a class="header-anchor" href="#timeutils-java" aria-label="Permalink to &quot;TimeUtils.java&quot;">​</a></h3><p><img src="'+p+'" alt="img.png"></p><p>The TimeUtils class in the framework.utility package provides utility functions to handle time strings and convert them into milliseconds. This is useful for standardizing time representations and performing time-based calculations in a consistent manner.</p><p>TIME_PATTERN: A regular expression pattern used to match various time formats. The supported formats are:</p><ul><li>d days hⓂ️s.s</li><li>hⓂ️s.s</li><li>m:s.s</li><li>s.s</li></ul><p><strong>Methods:</strong></p><ol><li>convertToMilliseconds Method</li></ol><p>This method converts a time string into milliseconds based on the matched pattern. If the time string does not match any recognized format, it returns a predefined constant for malformed time strings.</p><ul><li>The method first attempts to match the input time string against the TIME_PATTERN.</li><li>If the string matches the pattern, it initializes the time components (days, hours, minutes, seconds, milliseconds) to zero.</li><li>The method then extracts values based on the matching groups.</li><li>If any parsing errors occur (e.g., NumberFormatException) or if the string does not match the pattern, the method returns Config.MALFORMED_TIME_STRING.</li><li>If the parsing is successful, the method calculates the total duration in milliseconds</li></ul><h3 id="navigationwebelement" tabindex="-1">NavigationWebElement <a class="header-anchor" href="#navigationwebelement" aria-label="Permalink to &quot;NavigationWebElement&quot;">​</a></h3><p><img src="'+f+'" alt="img.png"></p><p>This NavigationWebElement class in the framework.model package, is a record class used to represent a navigation element within a web application framework. It offers a concise way to store and manage information about such elements.</p><ul><li><p>The class is defined as a record which is a recent addition to Java that simplifies creating immutable data classes.</p></li><li><p>It has three properties:</p><ul><li>name: A String representing the name or identifier of the navigation element in the menu bar(e.g., &quot;Activities&quot;, &quot; ECL&quot;, &quot;Files).</li><li>hrefValue: A String representing the href attribute value of the element, which typically specifies the URL linked to by the element.</li><li>webElement: A WebElement object from the Selenium library. This holds the actual WebElement instance representing the element in the web page.</li></ul></li><li><p>Due to the record nature, a constructor is not explicitly defined. The compiler generates a constructor that takes arguments for each property and initializes them.</p></li><li><p>The NavigationWebElement class offers a structured way to manage data related to navigation elements in a web application framework.</p></li></ul><h3 id="java-classes-for-representing-workunit-json-data" tabindex="-1">Java Classes for Representing Workunit JSON Data <a class="header-anchor" href="#java-classes-for-representing-workunit-json-data" aria-label="Permalink to &quot;Java Classes for Representing Workunit JSON Data&quot;">​</a></h3><p>This section details the class structure used to map JSON data file of list of &quot;Workunit&quot; entities into Java objects. These classes provide a clear representation of the data and allow for easy access to its values throughout the codebase. This structure is particularly beneficial for writing test cases, as it simplifies working with the data in a well-defined format. Below are the UML diagram of the classes used for JSON mapping to java objects for workunits JSON file.</p><p>So the first java object created to map the json is WUQueryRoot (equivalent to the root object of JSON) which contains the WUQueryResponse object (equivalent to the WUQueryResponse key in json file) inside it and WUQueryResponse contains the WUWorkunits object (equivalent to the Workunits key in json file) inside it, and then finally a list of WUECLWorkunit object (equivalent to the ECLWorkunit key in json file) is inside the WUWorkunits object. Inside each WUECLWorkunit object, there is WUApplicationValues object (equivalent to the ApplicationValues key in json), which further have a list of WUApplicationValue objects (equivalent to the ApplicationValue key in json file) inside it. This is how the structure of Java objects created with respect to the JSON structure of workunits.</p><p><img src="'+A+'" alt="img.png"></p><p><img src="'+b+'" alt="img.png"></p><p><img src="'+v+'" alt="img.png"></p><p><img src="'+q+'" alt="img.png"></p><p><img src="'+k+'" alt="img.png"></p><p><img src="'+T+'" alt="img.png"></p><h3 id="activitiestest" tabindex="-1">ActivitiesTest <a class="header-anchor" href="#activitiestest" aria-label="Permalink to &quot;ActivitiesTest&quot;">​</a></h3><p><img src="'+P+'" alt="img.png"></p><p>This ActivitiesTest class in the framework.pages package, implements a TestNG test (@Test) for the Activities page of ECL Watch UI. It focuses on verifying the following aspects of the Activities page:</p><ul><li>Presence of specific text elements</li><li>Functionality of navigation links and their corresponding sub-tabs</li></ul><p><strong>Class Variables:</strong></p><ul><li>textArray: A static final String array containing expected text elements to be present on the Activities page (e.g., &quot; Target/Wuid&quot;, &quot;Graph&quot;).</li></ul><p><strong>Methods:</strong></p><ol><li>testActivitiesPage (Test Method)</li></ol><ul><li>This is the main test method annotated with @Test to be run as a test case.</li><li>Initializes the WebDriver instance.</li><li>Use the Common.openWebPage method to navigate to the URL of the Activities page, retrieved from the urlMap.</li><li>Logs the start of the tests for the &quot;Activities&quot; page.</li><li>Calls testForAllText(driver) to check for the presence of predefined texts.</li><li>Retrieves the navigation web elements by calling getNavWebElements(driver).</li><li>Calls testForNavigationLinks(driver, navWebElements) to test the navigation links.</li><li>Logs the completion of the tests for the &quot;Activities&quot; page.</li></ul><ol start="2"><li>testForAllText Method</li></ol><ul><li>This method checks if specific texts are present on the &quot;Activities&quot; page.</li><li>Logs the start of text presence tests.</li><li>Iterates over each text in textArray.</li><li>Calls Common.checkTextPresent(driver, text, &quot;Activities Page&quot;) to verify the presence of each text on the page.</li></ul><ol start="3"><li>testForNavigationLinks Method</li></ol><ul><li>This method tests each navigation link to ensure they direct to the correct pages with the expected tabs.</li><li>Logs the start of navigation link tests.</li><li>Iterates over each NavigationWebElement in navWebElements.</li><li>Clicks on each navigation element and verifies the presence of corresponding tabs by calling testTabsForNavigationLinks(driver, element).</li><li>Logs success if all tabs are present; otherwise, logs an error with the current page details.</li><li>Catches and logs any exceptions that occur during the process.</li></ul><ol start="4"><li>getCurrentPage Method</li></ol><ul><li>This method determines the current page by checking the presence of specific tabs.</li><li>Iterates over each entry in tabsListMap.</li><li>Checks if all tabs for each page are present in the page source.</li><li>Returns the page name if all tabs are present; otherwise, returns &quot;Invalid Page&quot;.</li></ul><ol start="5"><li>testTabsForNavigationLinks Method:</li></ol><ul><li>This method verifies the presence of tabs for a given navigation element and updates the URL map with the tab URLs.</li><li>Get the list of tabs associated with the navigation element from URLConfig.tabsListMap.</li><li>Loop through each tab in the list.</li><li>Use Common.waitForElement to wait for the tab element to be present in the DOM.</li><li>Add the tab&#39;s URL to the urlMap under the corresponding navigation element.</li><li>If a timeout exception occurs, return false. Otherwise, return true.</li></ul><ol start="6"><li>getNavWebElements Method:</li></ol><ul><li>This method retrieves the web elements for the main navigation links on the Activities page.</li><li>Creates an empty list to store NavigationWebElement objects.</li><li>Iterates through the URLConfig.navNamesArray.</li><li>For each navigation link name: <ul><li>Finds the WebElement using driver.findElement with By.name strategy.</li><li>Extracts the href attribute value.</li><li>Creates a new NavigationWebElement object with the name, href value, and WebElement reference.</li><li>Adds the NavigationWebElement to the list.</li><li>Add the navigation element&#39;s URL to the urlMap.</li><li>Log any errors that occur during the process.</li></ul></li><li>Returns the list of NavigationWebElement objects.</li></ul><h3 id="basetabletest" tabindex="-1">BaseTableTest <a class="header-anchor" href="#basetabletest" aria-label="Permalink to &quot;BaseTableTest&quot;">​</a></h3><p><img src="'+C+'" alt="img.png"><img src="'+y+'" alt="img.png"></p><p>The BaseTableTest&lt;T&gt;\\ class is designed as a superclass for testing web pages containing tabular data. It is intended for use in automated tests, particularly for pages like workunits, files, and queries, and includes functionality for testing their respective details pages.<br> It defines methods for common functionalities like:</p><ul><li>Verifying the presence of expected text elements on the page.</li><li>Comparing the content displayed in the table with corresponding data from a JSON file.</li><li>Testing the sorting functionality of the table columns.</li><li>Verifying links within the table cells and their navigation behavior.</li><li>Testing common details functionality, such as tab clicks.</li></ul><p><strong>Abstract Methods:</strong></p><p>These methods must be implemented by subclasses to provide specific information and functionality for the page being tested:</p><ol><li>getPageName(): Returns the name of the page.</li><li>getPageUrl(): Returns the URL of the page.</li><li>getJsonFilePath(): Returns the file path for the JSON data file.</li><li>getSaveButtonDetailsPage(): Returns the text for the save button on the details page.</li><li>getColumnNames(): Returns an array of column names displayed in the table.</li><li>getDetailNames(): Returns an array of detail names for the details page.</li><li>getColumnKeys(): Returns an array of column keys for accessing data.</li><li>getDetailKeys(): Returns an array of detail keys for accessing data on the details page.</li><li>getCheckboxTypeForDetailsPage(): Returns the attribute type for checkboxes on the details page.</li><li>getAttributeTypeForDetailsPage(): Returns the attribute type for elements on the details page.</li><li>getAttributeValueForDetailsPage(): Returns the attribute value for elements on the details page.</li><li>getDetailKeysForPageLoad(): Returns an array of detail keys to check when the details page loads.</li><li>getUniqueKeyName(): Returns the unique key name for identifying data.</li><li>getUniqueKey(): Returns the unique key used for identifying data in the table.</li><li>getColumnKeysWithLinks(): Returns an array of column keys that contain links.</li><li>parseDataUIValue(dataUIValue, dataJSONValue, columnName, dataIDUIValue): Parses the UI data value.</li><li>parseDataJSONValue(dataJSONValue, columnName, dataIDUIValue): Parses the JSON data value.</li><li>parseJson(filePath): Parses the JSON file and returns a list of objects.</li><li>getColumnDataFromJson(object, columnKey): Gets column data from a JSON object.</li><li>sortJsonUsingSortOrder(currentSortOrder, columnKey): Sorts the JSON data using the specified order and column key.</li><li>getCurrentPage(): Returns the current page.</li><li>getJsonMap(): Returns a map of JSON data.</li><li>getColumnNamesForTabsDetailsPage(): Returns a map of column names for tabs on the details page.</li><li>getTabValuesForDetailsPage(): Returns an array of tab values for the details page.</li><li>testDetailSpecificFunctionality(name, i): Tests specific functionality on the details page.</li></ol><p><strong>Non-Abstract Methods:</strong></p><h4 id="method-testpage" tabindex="-1">Method: <code>testPage()</code> <a class="header-anchor" href="#method-testpage" aria-label="Permalink to &quot;Method: `testPage()`&quot;">​</a></h4><p>This method initiates and executes a series of tests on a web page.</p><ol><li><p><strong>Open the Web Page</strong>: The method begins by opening the specified web page using <code>Common.openWebPage(getPageUrl())</code>.</p></li><li><p><strong>Logging</strong>: It logs the start of tests for the page with <code>Common.logDebug</code>.</p></li><li><p><strong>Test for All Text</strong>: The method <code>testForAllText()</code> is called to verify the presence of expected text elements on the page.</p></li><li><p><strong>Retrieve JSON Objects</strong>: It retrieves all JSON objects using <code>getAllObjectsFromJson()</code> and stores them in <code>jsonObjects</code>.</p></li><li><p><strong>Dropdown Selection</strong>: If <code>jsonObjects</code> is not null, it determines the number of items in JSON (<code>numOfItemsJSON</code>) and uses <code>clickDropdown(numOfItemsJSON)</code> to select the appropriate dropdown value for displaying items on the page.</p></li><li><p><strong>Content and Sorting Tests</strong>: The method <code>testContentAndSortingOrder()</code> is called to verify the content and sorting order of items on the page.</p></li><li><p><strong>Link Tests</strong>: It calls <code>testLinksInTable()</code> to test all the links in the table present on the page.</p></li><li><p><strong>Logging</strong>: Logs the completion of tests with <code>Common.logDebug</code>.</p></li><li><p><strong>Exception Handling</strong>: Catches any exceptions that occur during the test and logs the error with <code>Common.logError</code>.</p></li></ol><h4 id="method-testdetailspage-string-name-int-i" tabindex="-1">Method: <code>testDetailsPage(String name, int i)</code> <a class="header-anchor" href="#method-testdetailspage-string-name-int-i" aria-label="Permalink to &quot;Method: `testDetailsPage(String name, int i)`&quot;">​</a></h4><p>This method tests various aspects of a details page for a specific item.</p><ol><li><p><strong>Test Detail Page Field Names</strong>: Depending on the configuration <code>Config.TEST_DETAIL_PAGE_FIELD_NAMES_ALL</code>, it calls <code>testForAllTextInDetailsPage(name)</code> either for all items or just the first item.</p></li><li><p><strong>Details Content Page Test</strong>: It calls <code>testDetailsContentPage(name)</code> to verify the content of the details page.</p></li><li><p><strong>Detail Specific Functionality Test</strong>: The method <code>testDetailSpecificFunctionality(name, i)</code> is called to test specific functionality on the details page.</p></li><li><p><strong>Test Tab Clicks</strong>: Depending on the configuration <code>Config.TEST_DETAIL_PAGE_TAB_CLICK_ALL</code>, it calls <code>testTabClickOnDetailsPage()</code> either for all items or just the first item.</p></li></ol><h4 id="method-testtabclickondetailspage" tabindex="-1">Method: <code>testTabClickOnDetailsPage()</code> <a class="header-anchor" href="#method-testtabclickondetailspage" aria-label="Permalink to &quot;Method: `testTabClickOnDetailsPage()`&quot;">​</a></h4><p>This method tests the functionality of clicking through different tabs on the details page.</p><ol><li><p><strong>Logging</strong>: Logs the start of the tab click test with <code>Common.logDebug</code>.</p></li><li><p><strong>Wait for Page Load</strong>: Calls <code>waitToLoadDetailsPage()</code> to ensure the details page is fully loaded.</p></li><li><p><strong>Iterate Through Tabs</strong>: For each tab value retrieved from <code>getTabValuesForDetailsPage()</code>:</p><ul><li>It tries to find the tab button element and clicks it using <code>javaScriptElementClick</code>.</li><li>It then calls <code>testPresenceOfColumnNames(getColumnNamesForTabsDetailsPage().get(tabValue), tabValue)</code> to verify the presence of expected column names for the selected tab.</li><li>If an error occurs, it logs the error with <code>Common.logError</code>.</li></ul></li></ol><h4 id="method-javascriptelementclick-webelement-element" tabindex="-1">Method: <code>javaScriptElementClick(WebElement element)</code> <a class="header-anchor" href="#method-javascriptelementclick-webelement-element" aria-label="Permalink to &quot;Method: `javaScriptElementClick(WebElement element)`&quot;">​</a></h4><p>This method clicks a web element using JavaScript.</p><ol><li><strong>Execute Script</strong>: Uses a <code>JavascriptExecutor</code> to click the specified web element by executing the script <code>arguments[0].click();</code>.</li></ol><h4 id="method-testpresenceofcolumnnames-list-string-columnnames-string-tabvalue" tabindex="-1">Method: <code>testPresenceOfColumnNames(List&lt;String&gt; columnNames, String tabValue)</code> <a class="header-anchor" href="#method-testpresenceofcolumnnames-list-string-columnnames-string-tabvalue" aria-label="Permalink to &quot;Method: `testPresenceOfColumnNames(List&lt;String&gt; columnNames, String tabValue)`&quot;">​</a></h4><p>This method verifies the presence of specific column names within a tab on the details page.</p><ol><li><p><strong>Check Column Names</strong>: For each column name in the provided list:</p><ul><li>It waits for the element containing the column name using <code>Common.waitForElement(By.xpath(&quot;//*[text()=&#39;&quot; + columnName + &quot;&#39;]&quot;))</code>.</li><li>If a <code>TimeoutException</code> occurs, it logs an error and sets a flag <code>allPresent</code> to false.</li></ul></li><li><p><strong>Logging</strong>: If all column names are present, it logs success with <code>Common.logDetail</code>. If any column name is missing, it logs an error.</p></li></ol><h4 id="method-clickonsavebutton" tabindex="-1">Method: <code>clickOnSaveButton()</code> <a class="header-anchor" href="#method-clickonsavebutton" aria-label="Permalink to &quot;Method: `clickOnSaveButton()`&quot;">​</a></h4><p>This method handles the action of clicking the save button on a details page.</p><ol><li><p><strong>Wait for Save Button</strong>: It retrieves the save button element using <code>getSaveButtonWebElementDetailsPage()</code> and waits for it to be clickable with <code>Common.waitForElementToBeClickable</code>.</p></li><li><p><strong>Click Save Button</strong>: Clicks the save button.</p></li><li><p><strong>Wait for Save Completion</strong>: Waits for the save button to become disabled using <code>Common.waitForElementToBeDisabled</code>.</p></li></ol><h4 id="method-testlinksintable" tabindex="-1">Method: <code>testLinksInTable()</code> <a class="header-anchor" href="#method-testlinksintable" aria-label="Permalink to &quot;Method: `testLinksInTable()`&quot;">​</a></h4><p>This method tests the functionality and navigation of links present in a table on the page.</p><ol><li><p><strong>Logging</strong>: Logs the start of the link tests with <code>Common.logDebug</code>.</p></li><li><p><strong>Page refresh</strong>: refreshing page as page has scrolled to right for testing the sorting functionality of column headers, so bringing it back to normal view by refreshing it</p></li><li><p><strong>Iterate Through Columns with Links</strong>: For each column key with links retrieved from <code>getColumnKeysWithLinks()</code>:</p><ul><li>It retrieves the data values from the UI using <code>getDataFromUIUsingColumnKey(columnKey)</code>.</li><li>For each value, it tries to find and click the corresponding link element.</li><li>After clicking, it checks if the page source contains the name to confirm successful navigation.</li><li>Logs success or failure based on the result.</li><li>It then navigates back to the original page and refreshes it.</li><li>It verifies if the dropdown value remains unchanged after navigation.</li></ul></li><li><p><strong>Exception Handling</strong>: Catches any exceptions during the link tests and logs the errors.</p></li></ol><h4 id="method-waittoloaddetailspage" tabindex="-1">Method: <code>waitToLoadDetailsPage()</code> <a class="header-anchor" href="#method-waittoloaddetailspage" aria-label="Permalink to &quot;Method: `waitToLoadDetailsPage()`&quot;">​</a></h4><p>This method ensures the details page is fully loaded by waiting for specific elements to be visible.</p><ol><li><p><strong>Initialize Wait Time</strong>: Starts with an initial wait time specified by <code>Config.WAIT_TIME_IN_SECONDS</code>.</p></li><li><p><strong>Check Element Visibility</strong>: Repeatedly checks the visibility of detail keys retrieved from <code>getDetailKeysForPageLoad()</code>:</p><ul><li>Waits for each element by its ID using <code>Common.waitForElement</code>.</li><li>If any element&#39;s attribute is empty, it continues waiting and increments the wait time.</li></ul></li><li><p><strong>Logging</strong>: Logs the total wait time used to load the details page with <code>Common.logDebug</code>.</p></li></ol><h4 id="method-testdetailscontentpage-string-name" tabindex="-1">Method: <code>testDetailsContentPage(String name)</code> <a class="header-anchor" href="#method-testdetailscontentpage-string-name" aria-label="Permalink to &quot;Method: `testDetailsContentPage(String name)`&quot;">​</a></h4><p>This method tests the content of a details page for a specific item.</p><ol><li><p><strong>Logging</strong>: Logs the start of the content tests with <code>Common.logDebug</code>.</p></li><li><p><strong>Wait for Page Load</strong>: Calls <code>waitToLoadDetailsPage()</code> to ensure the page is fully loaded.</p></li><li><p><strong>Compare Content</strong>: For each detail key:</p><ul><li>It retrieves the corresponding web element and its value.</li><li>Compares the value with the expected JSON value.</li><li>Logs errors if there are discrepancies.</li></ul></li><li><p><strong>Logging</strong>: Logs success if all values match the expected values.</p></li></ol><h4 id="method-testforalltextindetailspage-string-name" tabindex="-1">Method: <code>testForAllTextInDetailsPage(String name)</code> <a class="header-anchor" href="#method-testforalltextindetailspage-string-name" aria-label="Permalink to &quot;Method: `testForAllTextInDetailsPage(String name)`&quot;">​</a></h4><p>This method tests the presence of specific text elements on a details page.</p><ol><li><p><strong>Logging</strong>: Logs the start of the text tests with <code>Common.logDebug</code>.</p></li><li><p><strong>Check Text Presence</strong>: For each expected text element retrieved from <code>getDetailNames()</code>:</p><ul><li>Calls <code>Common.checkTextPresent</code> to verify the text presence on the page.</li></ul></li></ol><h4 id="method-testcontentandsortingorder" tabindex="-1">Method: <code>testContentAndSortingOrder()</code> <a class="header-anchor" href="#method-testcontentandsortingorder" aria-label="Permalink to &quot;Method: `testContentAndSortingOrder()`&quot;">​</a></h4><p>This method tests the content and sorting order of items on a page.</p><ol><li><p><strong>Logging</strong>: Logs the start of content tests with <code>Common.logDebug</code>.</p></li><li><p><strong>Test Table Content</strong>: Calls <code>testTableContent()</code> to verify the content of the table.</p></li><li><p><strong>Test Sorting Order</strong>: If the content test passes, it logs the start of sorting order tests and:</p><ul><li>Iterates through each column key and name.</li><li>Calls <code>testTheSortingOrderForOneColumn(columnKey, columnName)</code> to verify the sorting order.</li></ul></li></ol><h4 id="method-testthesortingorderforonecolumn-string-columnkey-string-columnname" tabindex="-1">Method: <code>testTheSortingOrderForOneColumn(String columnKey, String columnName)</code> <a class="header-anchor" href="#method-testthesortingorderforonecolumn-string-columnkey-string-columnname" aria-label="Permalink to &quot;Method: `testTheSortingOrderForOneColumn(String columnKey, String columnName)`&quot;">​</a></h4><p>This method tests the sorting order of a specific column.</p><ol><li><p><strong>Retrieve Sorting Order</strong>: Calls <code>getCurrentSortingOrder(columnKey)</code> to retrieve the current sorting order for the column.</p></li><li><p><strong>Compare Data</strong>: If a sorting order is retrieved, it:</p><ul><li>Retrieves data from the UI and JSON.</li><li>Sorts JSON data using the retrieved sorting order.</li><li>Compares the UI and JSON data.</li><li>Logs success if the data is correctly sorted; otherwise, logs an error.</li></ul></li></ol><h4 id="method-getcurrentsortingorder-string-columnkey" tabindex="-1">Method: <code>getCurrentSortingOrder(String columnKey)</code> <a class="header-anchor" href="#method-getcurrentsortingorder-string-columnkey" aria-label="Permalink to &quot;Method: `getCurrentSortingOrder(String columnKey)`&quot;">​</a></h4><p>This method retrieves the current sorting order of a column.</p><ol><li><p><strong>Find Column Header</strong>: Locates the column header element for the specified column key.</p></li><li><p><strong>Scrolls To Find Header</strong>: Uses JavascriptExecutor to scroll and bring the column header into view.</p></li><li><p><strong>Retrieve Sort Order</strong>: Retrieves the current sorting order from the column header&#39;s attribute <code>aria-sort</code>.</p></li><li><p><strong>Click to Change Sort Order</strong>: Clicks the column header to change the sort order and waits for the sorting order to change using <code>waitToLoadChangedSortOrder</code>.</p></li><li><p><strong>Return New Sort Order</strong>: Returns the new sorting order.</p></li></ol><h4 id="method-waittoloadchangedsortorder-string-oldsortorder-string-columnkey" tabindex="-1">Method: <code>waitToLoadChangedSortOrder(String oldSortOrder, String columnKey)</code> <a class="header-anchor" href="#method-waittoloadchangedsortorder-string-oldsortorder-string-columnkey" aria-label="Permalink to &quot;Method: `waitToLoadChangedSortOrder(String oldSortOrder, String columnKey)`&quot;">​</a></h4><p>This method waits for the sorting order to change after clicking a column header.</p><ol><li><p><strong>Initialize Wait Time</strong>: Starts with an initial wait time specified by <code>Config.WAIT_TIME_IN_SECONDS</code>.</p></li><li><p><strong>Check Sort Order Change</strong>: Repeatedly checks the sorting order of the column header until it changes from the old sort order.</p></li><li><p><strong>Return New Sort Order</strong>: Returns the new sorting order once it has changed.</p></li></ol><h4 id="method-getdatafromjsonusingcolumnkey-string-columnkey" tabindex="-1">Method: <code>getDataFromJSONUsingColumnKey(String columnKey)</code> <a class="header-anchor" href="#method-getdatafromjsonusingcolumnkey-string-columnkey" aria-label="Permalink to &quot;Method: `getDataFromJSONUsingColumnKey(String columnKey)`&quot;">​</a></h4><p>This method retrieves data from JSON objects for a specified column key.</p><ol><li><p><strong>Iterate Through JSON Objects</strong>: For each JSON object:</p><ul><li>Retrieves the column data using <code>getColumnDataFromJson</code>.</li></ul></li><li><p><strong>Return Data</strong>: Returns the list of column data.</p></li></ol><h4 id="method-getdatafromuiusingcolumnkey-string-columnkey" tabindex="-1">Method: <code>getDataFromUIUsingColumnKey(String columnKey)</code> <a class="header-anchor" href="#method-getdatafromuiusingcolumnkey-string-columnkey" aria-label="Permalink to &quot;Method: `getDataFromUIUsingColumnKey(String columnKey)`&quot;">​</a></h4><p>This method retrieves data from the UI based on a specified column key.</p><ol><li><strong>Initialize List</strong>: Starts by creating an empty list to store the data.</li><li><strong>Load UI Elements</strong>: Calls the <code>waitToLoadListOfAllUIObjects</code> method to get all web elements corresponding to the column key.</li><li><strong>Extract Text</strong>: Iterates through the list of web elements (excluding the header) and adds the text content of each element to the list.</li><li><strong>Error Handling</strong>: If any exception occurs, it logs an error message.</li><li><strong>Return Data</strong>: Finally, returns the list of extracted data.</li></ol><h4 id="method-waittoloadlistofalluiobjects-string-columnkey" tabindex="-1">Method: <code>waitToLoadListOfAllUIObjects(String columnKey)</code> <a class="header-anchor" href="#method-waittoloadlistofalluiobjects-string-columnkey" aria-label="Permalink to &quot;Method: `waitToLoadListOfAllUIObjects(String columnKey)`&quot;">​</a></h4><p>This method waits until all UI elements corresponding to a column key are loaded.</p><ol><li><strong>Initialize Wait Time</strong>: Starts with an initial wait time.</li><li><strong>Find Elements</strong>: Uses a loop to repeatedly find web elements in a grid cell matching the column key&#39;s XPath.</li><li><strong>Check Element Count</strong>: Checks if the number of elements (excluding the header) matches the number of JSON objects.</li><li><strong>Wait and Retry</strong>: If the elements are not fully loaded, it sleeps for the current wait time, increments the wait time, and retries.</li><li><strong>Return Elements</strong>: Once the elements are fully loaded, returns the list of web elements.</li></ol><h4 id="method-ascendingsortjson-string-columnkey" tabindex="-1">Method: <code>ascendingSortJson(String columnKey)</code> <a class="header-anchor" href="#method-ascendingsortjson-string-columnkey" aria-label="Permalink to &quot;Method: `ascendingSortJson(String columnKey)`&quot;">​</a></h4><p>This method sorts the JSON objects in ascending order based on a column key.</p><ol><li><strong>Sort JSON Objects</strong>: Uses a comparator to sort the list of JSON objects by comparing the values of the specified column key.</li><li><strong>Error Handling</strong>: If any exception occurs during sorting, logs an error message.</li></ol><h4 id="method-descendingsortjson-string-columnkey" tabindex="-1">Method: <code>descendingSortJson(String columnKey)</code> <a class="header-anchor" href="#method-descendingsortjson-string-columnkey" aria-label="Permalink to &quot;Method: `descendingSortJson(String columnKey)`&quot;">​</a></h4><p>This method sorts the JSON objects in descending order based on a column key.</p><ol><li><strong>Sort JSON Objects</strong>: Similar to <code>ascendingSortJson</code>, but uses a reversed comparator to sort the list in descending order.</li><li><strong>Error Handling</strong>: If any exception occurs during sorting, logs an error message.</li></ol><h4 id="method-testtablecontent" tabindex="-1">Method: <code>testTableContent()</code> <a class="header-anchor" href="#method-testtablecontent" aria-label="Permalink to &quot;Method: `testTableContent()`&quot;">​</a></h4><p>This method tests the content of a table by comparing the UI data with JSON data.</p><ol><li><strong>Log Number of Objects</strong>: Logs the number of objects retrieved from JSON.</li><li><strong>Retrieve UI Data</strong>: Calls <code>getDataFromUIUsingColumnKey</code> to get the data from the UI for the unique key.</li><li><strong>Compare Counts</strong>: Compares the number of objects from JSON and UI. Logs an error if they are not equal and returns false.</li><li><strong>Initialize Pass Flag</strong>: Initializes a flag to track if all comparisons pass.</li><li><strong>Iterate Through Columns</strong>: For each column key: <ul><li>Retrieves data from UI and JSON.</li><li>Calls <code>compareData</code> to compare the data and updates the pass flag based on the result.</li></ul></li><li><strong>Return Result</strong>: Returns the pass flag indicating whether all comparisons passed.</li></ol><h4 id="method-getallobjectsfromjson" tabindex="-1">Method: <code>getAllObjectsFromJson()</code> <a class="header-anchor" href="#method-getallobjectsfromjson" aria-label="Permalink to &quot;Method: `getAllObjectsFromJson()`&quot;">​</a></h4><p>This method retrieves all objects from a JSON file.</p><ol><li><strong>Get File Path</strong>: Retrieves the path of the JSON file.</li><li><strong>Parse JSON</strong>: Calls <code>parseJson</code> to parse the JSON file and return a list of objects.</li><li><strong>Error Handling</strong>: If any exception occurs during parsing, logs an error message.</li><li><strong>Return Data</strong>: Returns the list of parsed objects.</li></ol><h4 id="method-comparedata-list-object-dataui-list-object-datajson-list-object-dataidui-string-columnname" tabindex="-1">Method: <code>compareData(List&lt;Object&gt; dataUI, List&lt;Object&gt; dataJSON, List&lt;Object&gt; dataIDUI, String columnName)</code> <a class="header-anchor" href="#method-comparedata-list-object-dataui-list-object-datajson-list-object-dataidui-string-columnname" aria-label="Permalink to &quot;Method: `compareData(List&lt;Object&gt; dataUI, List&lt;Object&gt; dataJSON, List&lt;Object&gt; dataIDUI, String columnName)`&quot;">​</a></h4><p>This method compares the data from UI and JSON for a specific column.</p><ol><li><strong>Initialize Pass Flag</strong>: Initializes a flag to track if all comparisons pass.</li><li><strong>Iterate Through Data</strong>: For each item in the data lists: <ul><li>Parses the UI and JSON values.</li><li>Calls <code>checkValues</code> to compare the values and updates the pass flag based on the result.</li></ul></li><li><strong>Log Success</strong>: If all comparisons pass, logs a success message.</li><li><strong>Return Result</strong>: Returns the pass flag indicating whether all comparisons passed.</li></ol><h4 id="method-checkvalues-object-datauivalue-object-datajsonvalue-object-dataiduivalue-string-columnname" tabindex="-1">Method: <code>checkValues(Object dataUIValue, Object dataJSONValue, Object dataIDUIValue, String columnName)</code> <a class="header-anchor" href="#method-checkvalues-object-datauivalue-object-datajsonvalue-object-dataiduivalue-string-columnname" aria-label="Permalink to &quot;Method: `checkValues(Object dataUIValue, Object dataJSONValue, Object dataIDUIValue, String columnName)`&quot;">​</a></h4><p>This method checks if the UI value matches the JSON value for a specific column.</p><ol><li><strong>Compare Values</strong>: Compares the UI value with the JSON value.</li><li><strong>Log Error</strong>: If the values do not match, logs an error message.</li><li><strong>Return Result</strong>: Returns a boolean indicating whether the values match.</li></ol><h4 id="method-clickdropdown-int-numofitemsjson" tabindex="-1">Method: <code>clickDropdown(int numOfItemsJSON)</code> <a class="header-anchor" href="#method-clickdropdown-int-numofitemsjson" aria-label="Permalink to &quot;Method: `clickDropdown(int numOfItemsJSON)`&quot;">​</a></h4><p>This method selects a dropdown value based on the number of JSON items.</p><ol><li><strong>Find Dropdown</strong>: Locates and clicks the dropdown element.</li><li><strong>Wait for Dropdown List</strong>: Waits for the dropdown list to become visible.</li><li><strong>Determine Selected Value</strong>: Determines the smallest dropdown value greater than the number of JSON items.</li><li><strong>Select Option</strong>: Iterates through the options and clicks the one matching the selected value.</li><li><strong>Wait for Invisibility</strong>: Waits for the dropdown list to become invisible.</li><li><strong>Log and Refresh</strong>: Logs the selected value and refreshes the page.</li><li><strong>Error Handling</strong>: If any exception occurs, logs an error message.</li></ol><h4 id="method-getselecteddropdownvalue" tabindex="-1">Method: <code>getSelectedDropdownValue()</code> <a class="header-anchor" href="#method-getselecteddropdownvalue" aria-label="Permalink to &quot;Method: `getSelectedDropdownValue()`&quot;">​</a></h4><p>This method retrieves the currently selected value of a dropdown.</p><ol><li><strong>Find Dropdown</strong>: Locates the dropdown element.</li><li><strong>Retrieve Text</strong>: Gets and trims the text of the dropdown element.</li><li><strong>Error Handling</strong>: If any exception occurs, logs an error message.</li><li><strong>Return Value</strong>: Returns the retrieved text.</li></ol><h4 id="method-getsavebuttonwebelementdetailspage" tabindex="-1">Method: <code>getSaveButtonWebElementDetailsPage()</code> <a class="header-anchor" href="#method-getsavebuttonwebelementdetailspage" aria-label="Permalink to &quot;Method: `getSaveButtonWebElementDetailsPage()`&quot;">​</a></h4><p>This method retrieves the web element for the save button on the details page.</p><ol><li><strong>Locate Save Button</strong>: Uses an XPath to find the save button element.</li><li><strong>Return Element</strong>: Returns the located web element.</li></ol><h4 id="method-testforalltext" tabindex="-1">Method: <code>testForAllText()</code> <a class="header-anchor" href="#method-testforalltext" aria-label="Permalink to &quot;Method: `testForAllText()`&quot;">​</a></h4><p>This method tests the presence of specific text elements on a page.</p><ol><li><strong>Log Start</strong>: Logs the start of the text tests.</li><li><strong>Check Text</strong>: For each expected text element: <ul><li>Calls <code>Common.checkTextPresent</code> to verify the text presence on the page.</li></ul></li></ol><h3 id="eclworkunitstest" tabindex="-1">ECLWorkUnitsTest <a class="header-anchor" href="#eclworkunitstest" aria-label="Permalink to &quot;ECLWorkUnitsTest&quot;">​</a></h3><p><img src="'+w+'" alt="img.png"></p><p>This class, <code>ECLWorkUnitsTest</code>, in the framework.pages package, extends the <code>BaseTableTest</code> class and specifically implements test cases for the ECL Workunits page within the ECL Watch UI. It inherits functionalities for common table testing procedures and specializes them for the ECL Workunits data and behavior. It includes test cases for both the main page and the details page of the workunits.</p><h4 id="class-variables" tabindex="-1">Class Variables: <a class="header-anchor" href="#class-variables" aria-label="Permalink to &quot;Class Variables:&quot;">​</a></h4><ul><li>badStates: A list containing states considered as &#39;bad&#39;, such as &quot;compiled&quot; and &quot;failed&quot;.</li><li>sortByColumnKeyWhenSortedByNone: A string representing the column key used for sorting columns when no other sorting order is specified, or the sorting order is &quot;none&quot;.</li><li>costColumns: A list containing column names related to cost, used for specific parsing operations.</li><li>jsonMap: A map storing ECLWorkunit objects keyed by their unique identifiers (WUID).</li></ul><h4 id="methods" tabindex="-1">Methods: <a class="header-anchor" href="#methods" aria-label="Permalink to &quot;Methods:&quot;">​</a></h4><h4 id="method-testingeclworkunitspage" tabindex="-1">Method: <code>testingECLWorkUnitsPage</code> <a class="header-anchor" href="#method-testingeclworkunitspage" aria-label="Permalink to &quot;Method: `testingECLWorkUnitsPage`&quot;">​</a></h4><p>This method is a test method annotated with <code>@Test</code>, which indicates that it is a test case to be run using a testing framework like JUnit or TestNG. The method calls <code>testPage()</code> to execute the test logic for the ECL Work Units page.</p><ol><li>Annotate the method with <code>@Test</code> to indicate that it is a test case.</li><li>Within the method, call the <code>testPage()</code> method to perform the necessary testing actions on the ECL Work Units page.</li></ol><h4 id="method-getpagename" tabindex="-1">Method: <code>getPageName</code> <a class="header-anchor" href="#method-getpagename" aria-label="Permalink to &quot;Method: `getPageName`&quot;">​</a></h4><p>This method returns the name of the page being tested, which in this case is &quot;ECL Workunits&quot;.</p><ol><li>Override the method to return the string &quot;ECL Workunits&quot;.</li></ol><h4 id="method-getpageurl" tabindex="-1">Method: <code>getPageUrl</code> <a class="header-anchor" href="#method-getpageurl" aria-label="Permalink to &quot;Method: `getPageUrl`&quot;">​</a></h4><p>The getPageUrl method is designed to retrieve the URL of a specific page within the application. It overrides a method from a superclass, BaseTableTest, and provides the URL for the &quot;Workunits&quot; tab under the &quot;ECL&quot; navigation section. This URL is fetched from a pre-configured map of URLs.</p><ol><li>The method accesses the urlMap from the URLConfig class, which stores URL mappings for different navigation sections and their tabs.</li><li>The method fetches the URLMapping object for the &quot;ECL&quot; navigation section from the urlMap using URLConfig.NAV_ECL as the key.</li><li>From the URLMapping object of the &quot;ECL&quot; navigation section, the method retrieves the nested URL mapping for the &quot;Workunits&quot; tab using URLConfig.TAB_ECL_WORKUNITS as the key.</li><li>Finally, the method returns the URL associated with the &quot;Workunits&quot; tab.</li></ol><h4 id="method-getjsonfilepath" tabindex="-1">Method: <code>getJsonFilePath</code> <a class="header-anchor" href="#method-getjsonfilepath" aria-label="Permalink to &quot;Method: `getJsonFilePath`&quot;">​</a></h4><p>This method returns the file path of the JSON file containing Workunits test data. Combine the directory path (Config.PATH_FOLDER_JSON) with the filename (Config.WORKUNITS_JSON_FILE_NAME) to form the complete file path.</p><ol><li>Override the method to return the local path <code>Config.PATH_LOCAL_WORKUNITS_JSON</code> if the test is running locally.</li><li>Return the CI/CD path <code>Config.PATH_GH_ACTION_WORKUNITS_JSON</code> otherwise.</li></ol><h4 id="method-getcolumnnames" tabindex="-1">Method: <code>getColumnNames</code> <a class="header-anchor" href="#method-getcolumnnames" aria-label="Permalink to &quot;Method: `getColumnNames`&quot;">​</a></h4><p>This method returns an array of column names to be displayed on the ECL Work Units page.</p><ol><li>Override the method to return an array of column names: &quot;WUID&quot;, &quot;Owner&quot;, &quot;Job Name&quot;, &quot;Cluster&quot;, &quot;State&quot;, &quot;Total Cluster Time&quot;, &quot;Compile Cost&quot;, &quot;Execution Cost&quot;, &quot;File Access Cost&quot;.</li></ol><h4 id="method-getcolumnkeys" tabindex="-1">Method: <code>getColumnKeys</code> <a class="header-anchor" href="#method-getcolumnkeys" aria-label="Permalink to &quot;Method: `getColumnKeys`&quot;">​</a></h4><p>This method returns an array of column keys corresponding to the column names used in the JSON data.</p><ol><li>Override the method to return an array of column keys: &quot;Wuid&quot;, &quot;Owner&quot;, &quot;Jobname&quot;, &quot;Cluster&quot;, &quot;State&quot;, &quot;TotalClusterTime&quot;, &quot;Compile Cost&quot;, &quot;Execution Cost&quot;, &quot;File Access Cost&quot;.</li></ol><h4 id="method-getsavebuttondetailspage" tabindex="-1">Method: <code>getSaveButtonDetailsPage</code> <a class="header-anchor" href="#method-getsavebuttondetailspage" aria-label="Permalink to &quot;Method: `getSaveButtonDetailsPage`&quot;">​</a></h4><p>This method returns the label of the save button on the details page.</p><ol><li>Override the method to return the string &quot;Save&quot;.</li></ol><h4 id="method-getdetailnames" tabindex="-1">Method: <code>getDetailNames</code> <a class="header-anchor" href="#method-getdetailnames" aria-label="Permalink to &quot;Method: `getDetailNames`&quot;">​</a></h4><p>This method returns an array of detail names to be displayed on the work unit details page.</p><ol><li>Override the method to return an array of detail names: &quot;WUID&quot;, &quot;Action&quot;, &quot;State&quot;, &quot;Owner&quot;, &quot;Job Name&quot;, &quot;Description&quot;, &quot;Potential Savings&quot;, &quot;Compile Cost&quot;, &quot;Execution Cost&quot;, &quot;File Access Cost&quot;, &quot;Protected&quot;, &quot;Cluster&quot;, &quot;Total Cluster Time&quot;, &quot;Aborted by&quot;, &quot;Aborted time&quot;, &quot;Services&quot;.</li></ol><h4 id="method-getdetailkeys" tabindex="-1">Method: <code>getDetailKeys</code> <a class="header-anchor" href="#method-getdetailkeys" aria-label="Permalink to &quot;Method: `getDetailKeys`&quot;">​</a></h4><p>This method returns an array of detail keys corresponding to the detail names used in the JSON data.</p><ol><li>Override the method to wait for the element with ID &quot;state&quot; to load.</li><li>Check if the state value is in the list of bad states (<code>compiled</code>, <code>failed</code>).</li><li>If the state is in the bad states list, return a subset of detail keys: &quot;wuid&quot;, &quot;action&quot;, &quot;state&quot;, &quot;owner&quot;, &quot;jobname&quot;, &quot;cluster&quot;.</li><li>Otherwise, return the full array of detail keys: &quot;wuid&quot;, &quot;action&quot;, &quot;state&quot;, &quot;owner&quot;, &quot;jobname&quot;, &quot;compileCost&quot;, &quot;executeCost&quot;, &quot;fileAccessCost&quot;, &quot;protected&quot;, &quot;cluster&quot;, &quot;totalClusterTime&quot;.</li></ol><h4 id="method-getdetailkeysforpageload" tabindex="-1">Method: <code>getDetailKeysForPageLoad</code> <a class="header-anchor" href="#method-getdetailkeysforpageload" aria-label="Permalink to &quot;Method: `getDetailKeysForPageLoad`&quot;">​</a></h4><p>This method returns an array of keys to be used for loading the details page.</p><ol><li>Override the method to return an array of keys: &quot;wuid&quot;, &quot;state&quot;, &quot;jobname&quot;, &quot;cluster&quot;.</li></ol><h4 id="method-getcheckboxtypefordetailspage" tabindex="-1">Method: <code>getCheckboxTypeForDetailsPage</code> <a class="header-anchor" href="#method-getcheckboxtypefordetailspage" aria-label="Permalink to &quot;Method: `getCheckboxTypeForDetailsPage`&quot;">​</a></h4><p>This method returns the type of the checkbox used on the details page.</p><ol><li>Override the method to return the string &quot;checkbox&quot;.</li></ol><h4 id="method-getattributetypefordetailspage" tabindex="-1">Method: <code>getAttributeTypeForDetailsPage</code> <a class="header-anchor" href="#method-getattributetypefordetailspage" aria-label="Permalink to &quot;Method: `getAttributeTypeForDetailsPage`&quot;">​</a></h4><p>This method returns the attribute type used to identify elements on the details page.</p><ol><li>Override the method to return the string &quot;type&quot;.</li></ol><h4 id="method-getattributevaluefordetailspage" tabindex="-1">Method: <code>getAttributeValueForDetailsPage</code> <a class="header-anchor" href="#method-getattributevaluefordetailspage" aria-label="Permalink to &quot;Method: `getAttributeValueForDetailsPage`&quot;">​</a></h4><p>This method returns the attribute value used to identify elements on the details page.</p><ol><li>Override the method to return the string &quot;value&quot;.</li></ol><h4 id="method-getcolumnkeyswithlinks" tabindex="-1">Method: <code>getColumnKeysWithLinks</code> <a class="header-anchor" href="#method-getcolumnkeyswithlinks" aria-label="Permalink to &quot;Method: `getColumnKeysWithLinks`&quot;">​</a></h4><p>This method returns an array of column keys that contain links.</p><ol><li>Override the method to return an array with a single key: &quot;Wuid&quot;.</li></ol><h4 id="method-getuniquekeyname" tabindex="-1">Method: <code>getUniqueKeyName</code> <a class="header-anchor" href="#method-getuniquekeyname" aria-label="Permalink to &quot;Method: `getUniqueKeyName`&quot;">​</a></h4><p>This method returns the name of the unique key used to identify work units.</p><ol><li>Override the method to return the string &quot;WUID&quot;.</li></ol><h4 id="method-getuniquekey" tabindex="-1">Method: <code>getUniqueKey</code> <a class="header-anchor" href="#method-getuniquekey" aria-label="Permalink to &quot;Method: `getUniqueKey`&quot;">​</a></h4><p>This method returns the key used to uniquely identify work units.</p><ol><li>Override the method to return the string &quot;Wuid&quot;.</li></ol><h4 id="method-gettabvaluesfordetailspage" tabindex="-1">Method: <code>getTabValuesForDetailsPage</code> <a class="header-anchor" href="#method-gettabvaluesfordetailspage" aria-label="Permalink to &quot;Method: `getTabValuesForDetailsPage`&quot;">​</a></h4><p>This method returns an array of tab values for the details page.</p><ol><li>Define a method to return an array of tab values: &quot;variables&quot;, &quot;outputs&quot;, &quot;inputs&quot;, &quot;metrics&quot;, &quot;workflows&quot;, &quot;queries&quot;, &quot;resources&quot;, &quot;helpers&quot;, &quot;xml&quot;.</li></ol><h4 id="method-getcolumnnamesfortabsdetailspage" tabindex="-1">Method: <code>getColumnNamesForTabsDetailsPage</code> <a class="header-anchor" href="#method-getcolumnnamesfortabsdetailspage" aria-label="Permalink to &quot;Method: `getColumnNamesForTabsDetailsPage`&quot;">​</a></h4><p>This method returns a map where each key is the value attribute of an HTML element of a tab, and the value is a list of column names for that tab.</p><ol><li>Override the method to return a map of tab values and their corresponding column names: <ul><li>&quot;variables&quot;: [&quot;Type&quot;, &quot;Name&quot;, &quot;Value&quot;]</li><li>&quot;outputs&quot;: [&quot;Name&quot;, &quot;File Name&quot;, &quot;Value&quot;, &quot;Views&quot;]</li><li>&quot;inputs&quot;: [&quot;Name&quot;, &quot;File Cluster&quot;, &quot;Usage&quot;]</li><li>&quot;metrics&quot;: [&quot;Refresh&quot;, &quot;Hot spots&quot;, &quot;Timeline&quot;, &quot;Options&quot;] - there is no column in this tab, so checking the presence of these buttons</li><li>&quot;workflows&quot;: [&quot;Name&quot;, &quot;Subtype&quot;, &quot;Count&quot;, &quot;Remaining&quot;]</li><li>&quot;queries&quot;: [&quot;ID&quot;, &quot;Priority&quot;, &quot;Name&quot;, &quot;Target&quot;, &quot;WUID&quot;, &quot;Dll&quot;, &quot;Published By&quot;, &quot;Status&quot;]</li><li>&quot;resources&quot;: [&quot;Name&quot;, &quot;Refresh&quot;, &quot;Open&quot;, &quot;Preview&quot;] - Preview is not a column, it is a button, keeping it for additional check for Resources tab</li><li>&quot;helpers&quot;: [&quot;Type&quot;, &quot;Description&quot;, &quot;File Size&quot;]</li><li>&quot;xml&quot;: [&quot;&lt;?xml&quot;] - there is no column in this tab, so checking if a xml is present in this tab.</li><li>no tests for ECL and Logs tab for now as these are too complex to test</li></ul></li></ol><h4 id="method-getjsonmap" tabindex="-1">Method: <code>getJsonMap</code> <a class="header-anchor" href="#method-getjsonmap" aria-label="Permalink to &quot;Method: `getJsonMap`&quot;">​</a></h4><p>This method returns the JSON map containing the work unit data.</p><ol><li>Override the method to return the <code>jsonMap</code> containing work unit data. This map is populated in the <code>parseJson</code> method.</li></ol><h5 id="method-testdetailspecificfunctionality" tabindex="-1">Method: <code>testDetailSpecificFunctionality</code> <a class="header-anchor" href="#method-testdetailspecificfunctionality" aria-label="Permalink to &quot;Method: `testDetailSpecificFunctionality`&quot;">​</a></h5><ol><li><strong>Method Invocation</strong>: This method overrides a parent class method and is protected.</li><li><strong>Parameters</strong>: It takes two parameters: <code>wuName</code> (a String representing the work unit name) and <code>i</code> (an integer).</li><li><strong>Condition Check - Protected Button Functionality</strong>: <ul><li>The method first checks the <code>Config.TEST_WU_DETAIL_PAGE_PROTECTED_ALL</code> configuration value.</li><li>If this configuration is false and <code>i</code> is 0, or if the configuration is true, it calls <code>testProtectedButtonFunctionality</code> with <code>wuName</code> as the argument.</li></ul></li><li><strong>Condition Check - Description Update Functionality</strong>: <ul><li>Similarly, it checks the <code>Config.TEST_WU_DETAIL_PAGE_DESCRIPTION_ALL</code> configuration value.</li><li>If this configuration is false and <code>i</code> is 0, or if the configuration is true, it calls <code>testDescriptionUpdateFunctionality</code> with <code>wuName</code> as the argument.</li></ul></li></ol><h5 id="method-testdescriptionupdatefunctionality" tabindex="-1">Method: <code>testDescriptionUpdateFunctionality</code> <a class="header-anchor" href="#method-testdescriptionupdatefunctionality" aria-label="Permalink to &quot;Method: `testDescriptionUpdateFunctionality`&quot;">​</a></h5><ol><li><strong>Log Start</strong>: Logs the start of the description checkbox test for the details page.</li><li><strong>Try-Catch Block</strong>: <ul><li>Inside the try block: <ul><li>Retrieves a new description text from the configuration.</li><li>Calls <code>updateDescriptionAndSave</code> to update the description and save the new value, storing the old description.</li><li>Calls <code>testIfTheDescriptionUpdated</code> to verify if the description was updated successfully.</li><li>Logs the reverting of the description update and reverts the description to the old value using <code>updateDescriptionAndSave</code>.</li></ul></li><li>If an exception occurs, it catches the exception and logs an error message.</li></ul></li></ol><h5 id="method-testifthedescriptionupdated" tabindex="-1">Method: <code>testIfTheDescriptionUpdated</code> <a class="header-anchor" href="#method-testifthedescriptionupdated" aria-label="Permalink to &quot;Method: `testIfTheDescriptionUpdated`&quot;">​</a></h5><ol><li><strong>Page Refresh</strong>: Refreshes the current page.</li><li><strong>Wait for Details Page Load</strong>: Ensures the details page is fully loaded.</li><li><strong>Retrieve Description</strong>: Retrieves the updated description from the page element.</li><li><strong>Comparison and Logging</strong>: <ul><li>Compares the new description with the updated description.</li><li>Logs success if they match.</li><li>Logs an error if they don&#39;t match.</li></ul></li></ol><h5 id="method-updatedescriptionandsave" tabindex="-1">Method: <code>updateDescriptionAndSave</code> <a class="header-anchor" href="#method-updatedescriptionandsave" aria-label="Permalink to &quot;Method: `updateDescriptionAndSave`&quot;">​</a></h5><ol><li><strong>Wait for Details Page Load</strong>: Ensures the details page is fully loaded.</li><li><strong>Retrieve Old Description</strong>: Retrieves the current description from the page element.</li><li><strong>Update Description</strong>: <ul><li>Clears the existing text in the description element.</li><li>Enters the new description text.</li></ul></li><li><strong>Save Changes</strong>: Clicks the save button to save the new description.</li><li><strong>Retrieve Updated Description</strong>: Retrieves the description again to confirm the update.</li><li><strong>Log Details</strong>: Logs the old and updated descriptions.</li><li><strong>Return Old Description</strong>: Returns the old description for reverting later if needed.</li></ol><h5 id="method-testprotectedbuttonfunctionality" tabindex="-1">Method: <code>testProtectedButtonFunctionality</code> <a class="header-anchor" href="#method-testprotectedbuttonfunctionality" aria-label="Permalink to &quot;Method: `testProtectedButtonFunctionality`&quot;">​</a></h5><ol><li><strong>Log Start</strong>: Logs the start of the protected checkbox test for the details page.</li><li><strong>Try-Catch Block</strong>: <ul><li>Inside the try block: <ul><li>Calls <code>clickProtectedCheckboxAndSave</code> to click the protected checkbox and save the new value, storing the new checkbox value.</li><li>Calls <code>checkProtectedStatusOnECLWorkunitsPage</code> to verify the protected status on the ECL Workunits page.</li><li>Navigates to the specific work unit&#39;s details page.</li><li>Calls <code>checkIfNewCheckBoxValuePresentInDetailsPage</code> to verify the new checkbox value on the details page.</li><li>If the new checkbox value is present, it logs the reverting of the checkbox value and reverts the value by calling <code>clickProtectedCheckboxAndSave</code> again.</li></ul></li><li>If an exception occurs, it catches the exception and logs an error message.</li></ul></li></ol><h5 id="method-checkifnewcheckboxvaluepresentindetailspage" tabindex="-1">Method: <code>checkIfNewCheckBoxValuePresentInDetailsPage</code> <a class="header-anchor" href="#method-checkifnewcheckboxvaluepresentindetailspage" aria-label="Permalink to &quot;Method: `checkIfNewCheckBoxValuePresentInDetailsPage`&quot;">​</a></h5><ol><li><strong>Wait for Details Page Load</strong>: Ensures the details page is fully loaded.</li><li><strong>Retrieve Checkbox Value</strong>: Retrieves the current value of the protected checkbox.</li><li><strong>Comparison and Logging</strong>: <ul><li>Compares the current checkbox value with the new checkbox value.</li><li>Logs success if they match.</li><li>Logs an error if they don&#39;t match.</li></ul></li><li><strong>Return Comparison Result</strong>: Returns the result of the comparison.</li></ol><h5 id="method-clickprotectedcheckboxandsave" tabindex="-1">Method: <code>clickProtectedCheckboxAndSave</code> <a class="header-anchor" href="#method-clickprotectedcheckboxandsave" aria-label="Permalink to &quot;Method: `clickProtectedCheckboxAndSave`&quot;">​</a></h5><ol><li><strong>Wait for Details Page Load</strong>: Ensures the details page is fully loaded.</li><li><strong>Retrieve Old Checkbox Value</strong>: Retrieves the current value of the protected checkbox.</li><li><strong>Click Checkbox</strong>: Clicks the protected checkbox to change its value.</li><li><strong>Wait for Checkbox Update</strong>: Waits for the checkbox value to update using <code>waitToLoadUpdatedProtectedCheckbox</code>.</li><li><strong>Save Changes</strong>: Clicks the save button to save the new checkbox value.</li><li><strong>Retrieve New Checkbox Value</strong>: Retrieves the new value of the protected checkbox.</li><li><strong>Log Details</strong>: Logs the old and new checkbox values.</li><li><strong>Return New Checkbox Value</strong>: Returns the new checkbox value.</li></ol><h5 id="method-waittoloadupdatedprotectedcheckbox" tabindex="-1">Method: <code>waitToLoadUpdatedProtectedCheckbox</code> <a class="header-anchor" href="#method-waittoloadupdatedprotectedcheckbox" aria-label="Permalink to &quot;Method: `waitToLoadUpdatedProtectedCheckbox`&quot;">​</a></h5><ol><li><strong>Initialization</strong>: Initializes a wait time and a loop to wait for the checkbox value to update.</li><li><strong>Loop</strong>: <ul><li>Within the loop: <ul><li>Waits for a specified time.</li><li>Retrieves the current value of the protected checkbox.</li><li>Checks if the new checkbox value is different from the old value.</li><li>Breaks the loop if the value has updated.</li></ul></li><li>Increments the wait time if the value has not updated.</li></ul></li><li><strong>Loop Exit</strong>: Exits the loop if the wait time exceeds a predefined threshold.</li></ol><h5 id="method-checkprotectedstatusoneclworkunitspage" tabindex="-1">Method: <code>checkProtectedStatusOnECLWorkunitsPage</code> <a class="header-anchor" href="#method-checkprotectedstatusoneclworkunitspage" aria-label="Permalink to &quot;Method: `checkProtectedStatusOnECLWorkunitsPage`&quot;">​</a></h5><ol><li><strong>Page Navigation</strong>: Navigates to the ECL Workunits page and refreshes it.</li><li><strong>Retrieve Column Data</strong>: <ul><li>Retrieves data for work unit IDs and protected statuses from the UI.</li></ul></li><li><strong>Comparison and Logging</strong>: <ul><li>Iterates through the protected status data and work unit IDs data.</li><li>Compares the work unit ID with the given <code>wuName</code>.</li><li>If it matches <ul><li>Logs success if the protected status matches the expected value.</li><li>Logs an error if the protected status does not match the expected value.</li></ul></li><li>Breaks the for loop as the protected testing is done for that workunit.</li></ul></li></ol><h5 id="method-parsejson" tabindex="-1">Method: <code>parseJson</code> <a class="header-anchor" href="#method-parsejson" aria-label="Permalink to &quot;Method: `parseJson`&quot;">​</a></h5><ol><li><strong>Object Mapper</strong>: Uses an ObjectMapper to read and parse the JSON file at the specified file path.</li><li><strong>Parse JSON</strong>: <ul><li>Parses the JSON file into a <code>WUQueryRoot</code> object.</li><li>Retrieves the <code>WUQueryResponse</code> object from the root.</li><li>Retrieves the list of <code>ECLWorkunit</code> objects from the response.</li></ul></li><li><strong>Populate JSON Map</strong>: Populates the <code>jsonMap</code> with work unit IDs as keys and corresponding <code>ECLWorkunit</code> objects as values.</li><li><strong>Return Workunits</strong>: Returns the list of <code>ECLWorkunit</code> objects.</li></ol><h5 id="method-getcolumndatafromjson" tabindex="-1">Method: <code>getColumnDataFromJson</code> <a class="header-anchor" href="#method-getcolumndatafromjson" aria-label="Permalink to &quot;Method: `getColumnDataFromJson`&quot;">​</a></h5><ol><li><strong>Switch Case</strong>: Uses a switch statement to return the appropriate column data from the <code>ECLWorkunit</code> object based on the provided column key.</li><li><strong>Column Mapping</strong>: Maps specific column keys to corresponding fields in the <code>ECLWorkunit</code> object.</li><li><strong>Default Case</strong>: Returns null if the column key does not match any predefined cases.</li></ol><h5 id="method-parsedatauivalue" tabindex="-1">Method: <code>parseDataUIValue</code> <a class="header-anchor" href="#method-parsedatauivalue" aria-label="Permalink to &quot;Method: `parseDataUIValue`&quot;">​</a></h5><ol><li><strong>Cost Column Handling</strong>: Converts cost column data to a double if the column name is in the cost columns list.</li><li><strong>Time Conversion</strong>: <ul><li>Converts the UI time string to milliseconds if the column name is &quot;Total Cluster Time&quot;.</li><li>Checks for malformed time strings and logs an error if found.</li></ul></li><li><strong>String Trimming</strong>: Trims the UI value if it is a string.</li><li><strong>Exception Handling</strong>: Catches and logs any exceptions that occur during parsing.</li><li><strong>Return Parsed Value</strong>: Returns the parsed UI value.</li></ol><h5 id="method-parsedatajsonvalue" tabindex="-1">Method: <code>parseDataJSONValue</code> <a class="header-anchor" href="#method-parsedatajsonvalue" aria-label="Permalink to &quot;Method: `parseDataJSONValue`&quot;">​</a></h5><ol><li><strong>Time Conversion</strong>: <ul><li>Converts JSON time data to milliseconds if the column name is &quot;Total Cluster Time&quot;.</li><li>Checks for malformed time strings and logs an error if found.</li></ul></li><li><strong>Return Parsed Value</strong>: Returns the parsed JSON value.</li></ol><h5 id="method-sortjsonusingsortorder" tabindex="-1">Method: <code>sortJsonUsingSortOrder</code> <a class="header-anchor" href="#method-sortjsonusingsortorder" aria-label="Permalink to &quot;Method: `sortJsonUsingSortOrder`&quot;">​</a></h5><ol><li><strong>Switch Case</strong>: Uses a switch statement to determine the current sort order.</li><li><strong>Sort Order Handling</strong>: <ul><li>Calls <code>ascendingSortJson</code> if the current sort order is &quot;ascending&quot;.</li><li>Calls <code>descendingSortJson</code> if the current sort order is &quot;descending&quot;.</li><li>Calls <code>descendingSortJson</code> with the unique key if the sort order is &quot;none&quot;.</li></ul></li></ol><h5 id="method-getcurrentpage" tabindex="-1">Method: <code>getCurrentPage</code> <a class="header-anchor" href="#method-getcurrentpage" aria-label="Permalink to &quot;Method: `getCurrentPage`&quot;">​</a></h5><ol><li><strong>Retrieve Page Element</strong>: Attempts to retrieve the current page element by its ID.</li><li><strong>Return Page Title</strong>: Returns the title attribute of the page element if found.</li><li><strong>Exception Handling</strong>: Catches and logs any exceptions that occur.</li><li><strong>Return Default</strong>: Returns &quot;Invalid Page&quot; if the page element is not found or an exception occurs.</li></ol><h3 id="java-classes-for-representing-logical-files-json-data" tabindex="-1">Java Classes for Representing Logical Files JSON Data <a class="header-anchor" href="#java-classes-for-representing-logical-files-json-data" aria-label="Permalink to &quot;Java Classes for Representing Logical Files JSON Data&quot;">​</a></h3><p>This section details the class structure used to map JSON data file of list of &quot;Logical Files&quot; entities into Java objects. These classes provide a clear representation of the data and allow for easy access to its values throughout the codebase. This structure is particularly beneficial for writing test cases, as it simplifies working with the data in a well-defined format. Below are the UML diagrams of the classes used for JSON mapping to java objects for logical files JSON files.</p><p>So the first java object created to map the json is DFUQueryRoot (equivalent to the root object of json) which contains the DFUQueryResponse object (equivalent to the DFUQueryResponse key in json) inside it and DFUQueryResponse contains the DFULogicalFiles object (equivalent to the DFULogicalFiles key in json) inside it, and then finally a list of DFULogicalFile object (equivalent to the DFULogicalFile key in json) is inside the DFULogicalFiles object. This is how the structure of Java objects created with respect to the JSON structure of logical files.</p><p><img src="'+S+'" alt="img.png"></p><p><img src="'+L+'" alt="img.png"></p><p><img src="'+O+'" alt="img.png"></p><p><img src="'+N+'" alt="img.png"></p><h3 id="fileslogicalfilestest" tabindex="-1">FilesLogicalFilesTest <a class="header-anchor" href="#fileslogicalfilestest" aria-label="Permalink to &quot;FilesLogicalFilesTest&quot;">​</a></h3><p><img src="'+R+'" alt="img.png"></p><p>The FilesLogicalFilesTest class is a subclass of BaseTableTest designed to test the &quot;Files LogicalFiles&quot; page of a web application. It includes test cases for verifying the functionality and data consistency of the LogicalFiles tab and the details page of logical files. This class uses configuration data and JSON files to automate and validate the ECL Watch UI elements and underlying data of Logical Files Tab in the Files navigation menu.</p><h4 id="variables-1" tabindex="-1">Variables: <a class="header-anchor" href="#variables-1" aria-label="Permalink to &quot;Variables:&quot;">​</a></h4><ul><li><code>sortByColumnKeyWhenSortedByNone</code>: Specifies the column key used for sorting columns when no sort order is specified, or the sorting order is &quot;none&quot;.</li><li><code>costColumns</code>: A list of column names related to cost.</li><li><code>jsonMap</code>: A map to store logical files keyed by their names for quick lookup.</li></ul><h4 id="methods-implementation" tabindex="-1">Methods Implementation: <a class="header-anchor" href="#methods-implementation" aria-label="Permalink to &quot;Methods Implementation:&quot;">​</a></h4><ol><li><p><strong><code>testingECLWorkUnitsPage</code></strong></p><ul><li>Purpose: This is a test method annotated with <code>@Test</code>, indicating that it is a test case. It triggers the <code>testPage</code> method to perform the automated tests on the &quot;Files LogicalFiles&quot; page.</li><li>Code Flow: <ol><li>Call the <code>testPage</code> method, which handles the test execution for the page.</li></ol></li></ul></li><li><p><strong><code>getPageName</code></strong></p><ul><li>Purpose: Returns the name of the page being tested.</li><li>Code Flow: <ol><li>Return the string &quot;Files LogicalFiles&quot;.</li></ol></li></ul></li><li><p><strong><code>getPageUrl</code></strong></p><ul><li>Purpose: Retrieves the URL of the &quot;Files LogicalFiles&quot; page from the configuration.</li><li>Code Flow: <ol><li>Try to get the URL from <code>URLConfig</code> using the key <code>URLConfig.NAV_FILES</code> and <code>URLConfig.TAB_FILES_LOGICAL_FILES</code>.</li><li>If successful, return the URL.</li><li>If an exception occurs, log the exception using <code>Common.logException</code> and return an empty string.</li></ol></li></ul></li><li><p><strong><code>getJsonFilePath</code></strong></p><ul><li>Purpose: Provides the file path of the JSON file used for testing.</li><li>Code Flow: <ol><li>Return the path by concatenating <code>Config.PATH_FOLDER_JSON</code> and <code>Config.FILES_JSON_FILE_NAME</code>.</li></ol></li></ul></li><li><p><strong><code>getColumnNames</code></strong></p><ul><li>Purpose: Returns an array of column header names displayed on the UI.</li><li>Code Flow: <ol><li>Return a predefined array of column names such as &quot;Logical Name&quot;, &quot;Owner&quot;, &quot;Super Owner&quot;, etc.</li></ol></li></ul></li><li><p><strong><code>getColumnKeys</code></strong></p><ul><li>Purpose: Provides the identifiers used in the HTML code for the respective columns.</li><li>Code Flow: <ol><li>Return an array of column keys like &quot;Name&quot;, &quot;Owner&quot;, &quot;SuperOwners&quot;, etc.</li></ol></li></ul></li><li><p><strong><code>getSaveButtonDetailsPage</code></strong></p><ul><li>Purpose: Returns the label of the save button on the details page.</li><li>Code Flow: <ol><li>Return the string &quot;Save&quot;.</li></ol></li></ul></li><li><p><strong><code>getDetailNames</code> and <code>getDetailKeys</code></strong></p><ul><li>Purpose: These methods return arrays of detail names and keys for the details page.</li><li>Code Flow: <ol><li>Return empty arrays as placeholders. Code needs to be added here when writing test cases for details page of logical files.</li></ol></li></ul></li><li><p><strong><code>getDetailKeysForPageLoad</code></strong></p><ul><li>Purpose: Provides the keys used to load details on the page.</li><li>Code Flow: <ol><li>Return an empty array. Code needs to be added here when writing test cases for details page of logical files.</li></ol></li></ul></li><li><p><strong><code>getCheckboxTypeForDetailsPage</code></strong></p><ul><li>Purpose: Specifies the type of checkbox used on the details page.</li><li>Code Flow: <ol><li>Return the string &quot;checkbox&quot;.</li></ol></li></ul></li><li><p><strong><code>getAttributeTypeForDetailsPage</code></strong></p><ul><li>Purpose: Returns the attribute type used on the details page.</li><li>Code Flow: <ol><li>Return the string &quot;type&quot;.</li></ol></li></ul></li><li><p><strong><code>getAttributeValueForDetailsPage</code></strong></p><ul><li>Purpose: Returns the attribute value used on the details page.</li><li>Code Flow: <ol><li>Return the string &quot;value&quot;.</li></ol></li></ul></li><li><p><strong><code>getColumnKeysWithLinks</code></strong></p><ul><li>Purpose: Provides column keys that contain links.</li><li>Code Flow: <ol><li>Return an array with the key &quot;Name&quot;.</li></ol></li></ul></li><li><p><strong><code>getUniqueKeyName</code> and <code>getUniqueKey</code></strong></p><ul><li>Purpose: These methods return the unique key name and key used to identify logical files.</li><li>Code Flow: <ol><li><code>getUniqueKeyName</code>: Return the string &quot;Logical Name&quot;.</li><li><code>getUniqueKey</code>: Return the string &quot;Name&quot;.</li></ol></li></ul></li><li><p><strong><code>getTabValuesForDetailsPage</code></strong></p><ul><li>Purpose: Returns the tab values for the details page.</li><li>Code Flow: <ol><li>Return an empty array. Code needs to be added here when writing test cases for details page of logical files.</li></ol></li></ul></li><li><p><strong><code>getColumnNamesForTabsDetailsPage</code></strong></p><ul><li>Purpose: Provides column names for tabs on the details page.</li><li>Code Flow: <ol><li>Return an empty map using <code>Map.ofEntries()</code>. Code needs to be added here when writing test cases for details page of logical files.</li></ol></li></ul></li><li><p><strong><code>getJsonMap</code></strong></p><ul><li>Purpose: Returns the <code>jsonMap</code> containing logical files.</li><li>Code Flow: <ol><li>Return the <code>jsonMap</code>.</li></ol></li></ul></li><li><p><strong><code>testDetailSpecificFunctionality</code></strong></p><ul><li>Purpose: Placeholder for implementing test-specific functionality for details.</li><li>Code Flow: <ol><li>Empty method for potential overrides. Code needs to be added here when writing test cases for details page of logical files.</li></ol></li></ul></li><li><p><strong><code>parseJson</code></strong></p><ul><li>Purpose: Parses a JSON file and returns a list of <code>DFULogicalFile</code> objects.</li><li>Code Flow: <ol><li>Create an <code>ObjectMapper</code> instance.</li><li>Read the JSON file into a <code>DFUQueryRoot</code> object.</li><li>Extract the <code>DFUQueryResponse</code> from the root.</li><li>Retrieve the list of <code>DFULogicalFile</code> objects.</li><li>Populate the <code>jsonMap</code> with logical files keyed by their names.</li><li>Return the list of logical files.</li></ol></li></ul></li><li><p><strong><code>getColumnDataFromJson</code></strong></p><ul><li>Purpose: Extracts data from a <code>DFULogicalFile</code> object based on a given column key.</li><li>Code Flow: <ol><li>Use a <code>switch</code> statement to match the column key and return the corresponding value from the <code>DFULogicalFile</code> object.</li></ol></li></ul></li><li><p><strong><code>parseDataUIValue</code></strong></p><ul><li>Purpose: Parses and formats the UI value for comparison. Code needs to be added here for parsing other column values from UI that needs to be processed before comparing them with JSON.</li><li>Code Flow: <ol><li>Check if the column name is in <code>costColumns</code>.</li><li>If it is, convert the value to a double after splitting by space.</li><li>If the value is a string, trim any whitespace.</li><li>Log exceptions if parsing fails using <code>Common.logException</code>.</li><li>Return the parsed UI value.</li></ol></li></ul></li><li><p><strong><code>parseDataJSONValue</code></strong></p><ul><li>Purpose: Parses the JSON value for comparison. Code needs to be added here for parsing other JSON values that needs to be processed before comparing them with UI values.</li><li>Code Flow: <ol><li>Return the JSON value directly.</li></ol></li></ul></li><li><p><strong><code>sortJsonUsingSortOrder</code></strong></p><ul><li>Purpose: Sorts the JSON data based on the current sort order and column key.</li><li>Code Flow: <ol><li>Use a <code>switch</code> statement to determine the sort order.</li><li>Call <code>ascendingSortJson</code> for ascending order.</li><li>Call <code>descendingSortJson</code> for descending order.</li><li>Call <code>descendingSortJson</code> with <code>sortByColumnKeyWhenSortedByNone</code> if no sort order is specified.</li></ol></li></ul></li><li><p><strong><code>getCurrentPage</code></strong></p><ul><li>Purpose: Returns the name of the current page. Code needs to be added here when writing test cases for details page of logical files.</li><li>Code Flow: <ol><li>Return the string &quot;Invalid Page&quot;.</li></ol></li></ul></li></ol><h3 id="class-relationship-structure" tabindex="-1">Class Relationship Structure: <a class="header-anchor" href="#class-relationship-structure" aria-label="Permalink to &quot;Class Relationship Structure:&quot;">​</a></h3><p><img src="'+V+'" alt="img.png"></p>',330)]))}const D=t(x,[["render",z]]);export{j as __pageData,D as default};
